async function countdownTimerAtOrUnder(selector, seconds) {
    const bindId = `${selector}:${seconds}`;

    return Evergage.DisplayUtils.bind(bindId).pageElementLoaded(selector, "html").then((elem) => {
        return new Promise((resolve) => {
            const observer = new MutationObserver((mutationBatch) => {
                for (const mutation of mutationBatch) {
                    const timerText = mutation.target.textContent;
                    const [m, s] = timerText.split(" : ").map((c) => parseInt(c));
                    if (seconds >= (m * 60) + s) {
                        resolve(true);
                        Evergage.DisplayUtils.unbind(bindId);
                        observer.disconnect();
                    }
                }
            });

            observer.observe(elem, { characterData: true, subtree: true });
        });
    });
};

